import React from 'react';
import Header from '../../components/header/Header';
import './chat.css';

export default function Chat() {
  return (
    <>
      <Header />
      <div className='chat'>
        <div className='chatBox'></div>
        <div className='chatOnline'></div>
      </div>
    </>
  );
}
